n// ## Object\n// ## Default value: {\n  top: 0,\n  left: 0,\n  behaviour: &quot;smooth&quot;,   \n  timeout: 10, // timeout must be greater than 10 milliseconds\n}</b>\n{\nscrollProps: {\n  top: 0,\n  left: 0,\n  behaviour: &quot;smooth&quot;,\n  timeout: 10, // timeout must be greater than 10 milliseconds\n}, \n\n<b class="scr-b">// How to set in the store</b>\nSCR_CONFIG_STORE.setScrollProps({\n  top: 0,\n  left: 0,\n  behaviour: &quot;smooth&quot;,\n  timeout: 10,\n});',le=C(),ce=R("p"),ce.textContent="So that is it for this section. But the configuration store is not over yet.\n    The next properties has its own sections each. Click next to see more\n    information.",ue=C(),fe=R("center"),fe.innerHTML='<small class="scr-small">The configuration for this route.</small>',pe=C(),he=R("pre"),he.textContent='{\n    name: "configurationOptionsRoute",\n    path: "/svelte-client-router/configurationOptions",\n    lazyLoadComponent: () => import("./docs/pages/SCR_ConfigurationOptions.svelte"),\n    title: "SCR - Configuration Options",\n}',me=C(),lt(de.$$.fragment),_(n,"class","scr-h4"),_(l,"class","scr-pre"),_(p,"class","scr-hr"),_(m,"class","scr-h4"),_(b,"class","scr-text-justify"),_(x,"class","scr-pre"),_(w,"class","scr-hr"),_(E,"class","scr-h4"),_(L,"class","scr-text-justify"),_(q,"class","scr-pre"),_(N,"class","scr-hr"),_(M,"class","scr-h4"),_(A,"class","scr-text-justify"),_(D,"class","scr-pre"),_(W,"class","scr-hr"),_(V,"class","scr-h4"),_(J,"class","scr-text-justify"),_(X,"class","scr-pre"),_(tt,"class","scr-hr"),_(rt,"class","scr-h4"),_(at,"class","scr-text-justify"),_(ft,"class","scr-pre"),_(ht,"class","scr-hr"),_(dt,"class","scr-h4"),_(gt,"class","scr-text-justify"),_(yt,"class","scr-pre"),_(Rt,"class","scr-hr"),_(Ct,"class","scr-h4"),_(wt,"class","scr-text-justify"),_(St,"class","scr-pre"),_(Ot,"class","scr-hr"),_(jt,"class","scr-h4"),_(Pt,"class","scr-text-justify"),_(It,"class","scr-pre"),_(Ft,"class","scr-hr"),_(Bt,"class","scr-h4"),_(Ht,"class","scr-tex